import React from "react";

import "./sign-in.styles.scss";

import PersonalizedButton from "../personalized-button/personalized-button.component";
import CustomFormInput from "../custom-form-input/custom-form-input.component";

import { signInWithGoogle } from "../../firebase/firebase.utils";

class SignIn extends React.Component {
  constructor() {
    super();

    this.state = {
      email: "",
      password: "",
    };
  }

  handleChange = (event) => {
    const { value, name } = event.target;
  };

  render() {
    return (
      <div className="sign-in">
        <form>
          <CustomFormInput
            name="email"
            type="email"
            value={this.state.email}
            label="email"
          />
          <CustomFormInput
            name="password"
            type="password"
            value={this.state.password}
            label="password"
          />

          <div className="buttons">
            <PersonalizedButton type="submite">Sign In</PersonalizedButton>
            <PersonalizedButton
              type="button"
              onClick={signInWithGoogle}
              googleSignIn
            >
              Sign In with Google
            </PersonalizedButton>
          </div>
        </form>
      </div>
    );
  }
}

export default SignIn;
